import { useEffect, useState } from "react";
import NewsCard from "./layout/NewsCard";
import Card from "./UI/Card";
function Home() {
   const [data,setData]=useState([]);
  async function getData() {
    const response = await fetch(
      "https://api.nytimes.com/svc/topstories/v2/world.json?api-key=9fw5bZorW3brppppfa95DpFlAAKfIQkE"
    );
    if (!response.ok) {
      return;
    }
    const responseData = await response.json();
    const resultList=await responseData.results;
    setData(resultList);
  }
  useEffect(() => {
      getData();

  }, [getData])

  return (
    <div>
      {data.map(e=>{
          return <Card><NewsCard title={e.title} desc={e.abstract} by={e.byline}/></Card>
      })}
    </div>
  );
}

export default Home;
